            const imageName = path.basename(imageUrl);
            const destinationPath = path.join(destinationDirectory, imageName);
          
            await downloadAndSaveImage(imageUrl, destinationPath);
            console.log(`Image downloaded and saved: ${imageName}, Index: ${index}`);
